INSERT INTO `v1_6d45dd9d761dfd8ac90b327e03149ced184366fda1eae00a75a7d2cf6a000092` VALUES (44, "東山奈央", "ヒヨリ", 2, 155, "こんにちは！　ヒヨリでっす！\n困っている人がいたら助けにいくよ！\nよかったら一緒に来ない？", "人助け、応援", 16, "人助けが大好き！　前向き格闘娘", 27, 8, "獣人族", "トゥインクルウィッシュ", 0, 100101, "A");
