INSERT INTO `v1_6d45dd9d761dfd8ac90b327e03149ced184366fda1eae00a75a7d2cf6a000092` VALUES (46, "早見沙織", "レイ", 2, 163, "キミと会ったのもきっと何かの縁だ\n一緒に塔の頂上を目指す仲間として\n頑張っていこう。よろしく頼む", "読書、乗馬、お茶", 18, "クールで何事にも真っ直ぐな剣士", 12, 1, "魔族", "トゥインクルウィッシュ", 0, 100301, "B");
INSERT INTO `v1_6d45dd9d761dfd8ac90b327e03149ced184366fda1eae00a75a7d2cf6a000092` VALUES (27, "諸星すみれ", "ミソギ", 5, 128, "イタズラなら任せて！\nにいちゃん、引っかからないように気を付けなよー♪", "いたずら、探検", 9, "探検好きのイタズラっ子", 10, 8, "ヒューマン", "リトルリリカル", 0, 100401, "O");
