INSERT INTO `v1_6d45dd9d761dfd8ac90b327e03149ced184366fda1eae00a75a7d2cf6a000092` VALUES (42, "浅倉杏美", "アカリ", 7, 150, "アカリ、まだわからないことが多くて…\nだからこれから\nいろいろ教えてくださいね、お兄ちゃん！", "サックス", 13, "甘え上手なみんなの人気者", 22, 11, "魔族", "悪魔偽王国軍（ディアボロス）", 0, 100601, "O");
INSERT INTO `v1_6d45dd9d761dfd8ac90b327e03149ced184366fda1eae00a75a7d2cf6a000092` VALUES (32, "雨宮天", "ミヤコ", 7, 130, "難しいことはわからないの～\nただ毎日プリンを食べられるなら、\n幽霊のままでいいの～", "プリンを食べること", 14, "プリン大好きゴースト娘", 23, 1, "魔族", "悪魔偽王国軍（ディアボロス）", 0, 100701, "B");
INSERT INTO `v1_6d45dd9d761dfd8ac90b327e03149ced184366fda1eae00a75a7d2cf6a000092` VALUES (40, "大空直美", "ユキ", 15, 150, "ボクって本当に美しいなあ…\n可愛くて美しいなんて本当に罪だと思うけど\n生まれもったものだから仕方ないんだ♪", "鏡で自分を見ること", 14, "ボクは誰よりも美しい", 10, 10, "エルフ", "ヴァイスフリューゲル　ランドソル支部", 0, 100801, "AB");
INSERT INTO `v1_6d45dd9d761dfd8ac90b327e03149ced184366fda1eae00a75a7d2cf6a000092` VALUES (45, "髙野麻美", "アンナ", 13, 159, "いいか、絶対に私を真名で呼ぶなよ？\n常に「機関」の眼や耳の存在を疑え\nそれが、生きのびるための術だ…！", "小説執筆", 17, "前世を信じる中二病患者、「疾風の冥姫」", 5, 7, "魔族", "トワイライトキャラバン", 0, 100901, "A");
INSERT INTO `v1_6d45dd9d761dfd8ac90b327e03149ced184366fda1eae00a75a7d2cf6a000092` VALUES (42, "内田真礼", "マホ", 10, 155, "マホマホ王国のお姫はんの、マホ姫どす！\nけったいな顔してどないしはったん？\nマホマホ王国はずーっと遠くの国なんどす？", "空想、ぬいぐるみ集め", 16, "マホマホ王国のプリンセス", 22, 9, "獣人族", "自警団（カォン）", 0, 101001, "O");
INSERT INTO `v1_6d45dd9d761dfd8ac90b327e03149ced184366fda1eae00a75a7d2cf6a000092` VALUES (44, "阿澄佳奈", "リノ", 3, 156, "覚えていないと思うんですけど…\n私は妹なんですよ！\nだからお兄ちゃんって呼んでいいですか？", "お裁縫", 15, "人懐っこくてマシンガントークな妹系少女", 25, 8, "ヒューマン", "ラビリンス", 0, 101101, "A");
