INSERT INTO `v1_6d45dd9d761dfd8ac90b327e03149ced184366fda1eae00a75a7d2cf6a000092` VALUES (21, "日高里菜", "ミミ", 5, 117, "ぴょんぴょん、うさぎさんになりたいな～♪　\nミミ、うさぎさんになれたら、\n最初におにいちゃんに見せてあげるね！", "かわいいもの集め", 10, "お歌もにんじんも、ウサギさんも大好き♪", 3, 4, "獣人族", "リトルリリカル", 0, 102001, "O");
INSERT INTO `v1_6d45dd9d761dfd8ac90b327e03149ced184366fda1eae00a75a7d2cf6a000092` VALUES (40, "植田佳奈", "クルミ", 9, 150, "あの、えっと…私、く、クルミですぅ…\nふ、ふぇぇぇ…ど、どうしようぅ…\nは、恥かしくて…ご、ごめんなさいぃぃ！", "観劇、おままごと", 12, "泣き虫で臆病な守ってあげたい女の子", 9, 6, "ヒューマン", "サレンディア救護院", 0, 102101, "B");
INSERT INTO `v1_6d45dd9d761dfd8ac90b327e03149ced184366fda1eae00a75a7d2cf6a000092` VALUES (40, "原紗友里", "ヨリ", 7, 150, "え、えっと…こ、こういうときって、\nどういうことを言えばいいんだっけ…\nうう、どうしてちゃんと喋れないの…", "ゲーム全般", 13, "人見知りであまのじゃくな女の子", 22, 11, "魔族", "悪魔偽王国軍（ディアボロス）", 0, 102201, "O");
