INSERT INTO `v1_6d45dd9d761dfd8ac90b327e03149ced184366fda1eae00a75a7d2cf6a000092` VALUES (43, "悠木碧", "スズメ", 9, 154, "うぅ…ごめんなさい～…\nまたキッチンを爆発させてしまいました～\nこれじゃあメイド失格です…", "ご奉仕", 15, "お嬢さまのためにがんばるドジっ娘メイド", 12, 12, "ヒューマン", "サレンディア救護院", 0, 102501, "O");
