INSERT INTO `v1_6d45dd9d761dfd8ac90b327e03149ced184366fda1eae00a75a7d2cf6a000092` VALUES (43, "堀江由衣", "サレン", 9, 156, "貧乏性？　いいえ、\n「もったいない」の精神で\n日々を過ごしてるだけよ！", "経営、お茶会", 17, "救護院を経営する優しい庶民派お嬢様", 4, 10, "エルフ", "サレンディア救護院", 0, 102801, "A");
