INSERT INTO `v1_6d45dd9d761dfd8ac90b327e03149ced184366fda1eae00a75a7d2cf6a000092` VALUES (44, "花澤香菜", "アオイ", 6, 158, "友達ができるその日まで…\nBB団で\nトレーニングですっ！", "友達作りのイメトレ", 13, "「友達」に憧れる、エルフの森の女の子", 6, 6, "エルフ", "フォレスティエ", 0, 104001, "AB");
