INSERT INTO `v1_6d45dd9d761dfd8ac90b327e03149ced184366fda1eae00a75a7d2cf6a000092` VALUES (54, "小松未可子", "マコト", 10, 168, "腹へってたら言えよな\n簡単でよければ\nすっげー旨いもん食わせてやるよ！", "お菓子作り", 17, "男勝りで情に厚いワイルド娘", 9, 8, "獣人族", "自警団（カォン）", 0, 104301, "O");
