INSERT INTO `v1_6d45dd9d761dfd8ac90b327e03149ced184366fda1eae00a75a7d2cf6a000092` VALUES (50, "川澄綾子", "ジュン", 8, 171, "？？？", "格闘技、湯浴み", 25, "素顔を見せない冷静沈着な女性騎士", 25, 10, "ヒューマン", "王宮騎士団（NIGHTMARE）", 0, 104701, "A");
