INSERT INTO `v1_6d45dd9d761dfd8ac90b327e03149ced184366fda1eae00a75a7d2cf6a000092` VALUES (48, "沼倉愛美", "タマキ（サマー）", 12, 158, "お金もうけの話なら、ぜひともあたしに\n持ってくるにゃ！　稼げるなら１ルピだって\n見逃さないのが、あたしの信条にゃ～♪", "猫とたわむれること", 18, "弱きを助け強きをくじく猫娘", 1, 3, "獣人族", "メルクリウス財団", 0, 107901, "AB");
INSERT INTO `v1_6d45dd9d761dfd8ac90b327e03149ced184366fda1eae00a75a7d2cf6a000092` VALUES (49, "田所あずさ", "ミフユ（サマー）", 12, 163, "私がキミの師匠になってあげる！\nもちろんタダとはいかないわ\n時給はしっかりもらうから", "傭兵などのアルバイト", 20, "仕事も私事も効率優先な傭兵少女", 11, 11, "ヒューマン", "メルクリウス財団", 0, 108001, "O");
INSERT INTO `v1_6d45dd9d761dfd8ac90b327e03149ced184366fda1eae00a75a7d2cf6a000092` VALUES (42, "大坪由佳", "シノブ（ハロウィン）", 7, 157, "私、小さい頃から人には見えないものが\n見えていたんです。今もあなたの後ろに\n一人、二人、三人…賑やかですね", "占い", 18, "占いが得意な霊能少女", 22, 12, "魔族", "悪魔偽王国軍（ディアボロス）", 0, 108101, "AB");
INSERT INTO `v1_6d45dd9d761dfd8ac90b327e03149ced184366fda1eae00a75a7d2cf6a000092` VALUES (32, "雨宮天", "ミヤコ（ハロウィン）", 7, 130, "難しいことはわからないの～\nただ毎日プリンを食べられるなら、\n幽霊のままでいいの～", "プリンを食べること", 14, "プリン大好きゴースト娘", 23, 1, "魔族", "悪魔偽王国軍（ディアボロス）", 0, 108201, "B");
INSERT INTO `v1_6d45dd9d761dfd8ac90b327e03149ced184366fda1eae00a75a7d2cf6a000092` VALUES (22, "久野美咲", "ミサキ（ハロウィン）", 14, 120, "アタシのこと呼んだ？\nレディの魅力で夢中にさせてあげるわね！", "ファッション誌鑑賞、コスメ集め", 11, "ちょっとおませな恋に恋する女の子", 3, 1, "魔族", "ルーセント学院", 0, 108301, "A");
INSERT INTO `v1_6d45dd9d761dfd8ac90b327e03149ced184366fda1eae00a75a7d2cf6a000092` VALUES (46, "福原綾香", "チカ（クリスマス）", 4, 163, "私は人々の平和を守るため、唱喚術を使って\n戦います。…最近は、ア、アイドルとしても\n活動してますが、そちらはまだ不慣れで…", "各種楽器", 17, "人々を守るために歌う、唱喚士の少女", 3, 6, "ヒューマン", "カルミナ", 0, 108401, "O");
INSERT INTO `v1_6d45dd9d761dfd8ac90b327e03149ced184366fda1eae00a75a7d2cf6a000092` VALUES (40, "植田佳奈", "クルミ（クリスマス）", 9, 150, "あの、えっと…私、く、クルミですぅ…\nふ、ふぇぇぇ…ど、どうしようぅ…\nは、恥かしくて…ご、ごめんなさいぃぃ！", "観劇、おままごと", 12, "泣き虫で臆病な守ってあげたい女の子", 9, 6, "ヒューマン", "サレンディア救護院", 0, 108501, "B");
INSERT INTO `v1_6d45dd9d761dfd8ac90b327e03149ced184366fda1eae00a75a7d2cf6a000092` VALUES (38, "芹澤優", "アヤネ（クリスマス）", 9, 148, "この子はね、ぷうきちって言うんだ\n武器なんだけど、しゃべるんだよ♪\n大事な大事な、私の友達なんだぁ～！", "屋内でできる遊び", 14, "ぷうきちといつも一緒！", 10, 5, "ヒューマン", "サレンディア救護院", 0, 108601, "B");
INSERT INTO `v1_6d45dd9d761dfd8ac90b327e03149ced184366fda1eae00a75a7d2cf6a000092` VALUES (44, "東山奈央", "ヒヨリ（ニューイヤー）", 2, 155, "こんにちは！　ヒヨリでっす！\n困っている人がいたら助けにいくよ！\nよかったら一緒に来ない？", "人助け、応援", 16, "人助けが大好き！　前向き格闘娘", 27, 8, "獣人族", "トゥインクルウィッシュ", 0, 108701, "A");
INSERT INTO `v1_6d45dd9d761dfd8ac90b327e03149ced184366fda1eae00a75a7d2cf6a000092` VALUES (47, "種田梨沙", "ユイ（ニューイヤー）", 2, 158, "あんまり役に立てるかはわからないけど…\nわたしも頑張って、\nみんなをサポートするね！", "料理、人間観察", 17, "戦闘のサポートが得意な、心優しい少女", 5, 4, "ヒューマン", "トゥインクルウィッシュ", 0, 108801, "O");
