INSERT INTO `v1_6d45dd9d761dfd8ac90b327e03149ced184366fda1eae00a75a7d2cf6a000092` VALUES (43, "橋本ちなみ", "エリコ（バレンタイン）", 13, 154, "『壊し屋』の二つ名を持つ私…\nですが、怖がる必要はありませんわ\nあなた様は大切な運命の人ですから…", "実験、裁縫、料理", 16, "運命の相手に一途すぎる乙女", 30, 7, "魔族", "トワイライトキャラバン", 0, 109001, "B");
