INSERT INTO `v1_6d45dd9d761dfd8ac90b327e03149ced184366fda1eae00a75a7d2cf6a000092` VALUES (45, "こやまきみこ", "ルゥ", "", 144, "ルゥはルゥですぅ！マナリア魔法学院に\n通ってるですぅ。あなたもルゥの\nお友だちになってくれるですか？", "食べること、眠ること", 15, "マナリア魔法学院の新入生", 4, 2, "ヒューマン", "？？？", 0, 109301, "O");
INSERT INTO `v1_6d45dd9d761dfd8ac90b327e03149ced184366fda1eae00a75a7d2cf6a000092` VALUES (67, "福原綾香", "グレア", "", 167, "私はグレア。竜と人、両方の血を\n受け継いでいるの…\nえっと…よ、よろしくね", "ピアノ", 17, "人を超越した力を有す心優しい竜姫", 3, 11, "半人半竜", "？？？", 0, 109401, "B");
